 обретает смысл лишь в том случае, если нам есть с кем поделиться нашими чувствами. Как правило, эти встречи происходят в тот миг, когда мы доходим до предела, когда испытываем потребность умереть и возродиться. Встречи ждут нас — но как часто мы сами уклоняемся от них! И когда мы пришли в отчаяние, поняв, что нам нечего терять, или наоборот — чересчур радуемся жизни, проявляется неизведанное...\" (Пауло Коэльо)\n\n\"Чтобы оценить чье-нибудь качество, надо иметь некоторую долю этого качества и в самом себе.\" (У.Шекспир)\n\n\"Не доверять друзьям позорнее, чем быть ими обманутым.\" (Француа де Ларощфуко)\n\n\"Мать - это имя Бога на устах и в сердцах маленьких детей\" (У.Теккерей)\n\n\"Тот счастлив, кто прошел среди мучений,\nСреди тревог и страсти жизни шумной,\nПодобно розе, что цветет бездумно,\nИ легче по водам бегущей тени...\" (А.Ахматова)\n\nЖенщина может быть личностью или вещью. Она - личность, если не испытывает зависимости от человека, которого любит, если она хозяйка своих суждений и планов, своего тела и мыслей. Она - вещь, если позволяет обращаться с собой как с вещью, быть может, прекрасной и драгоценной, но не имеющей собственной воли, подчиняющейся желаниям и капризам хозяина, - нечто вроде приятного блюда, утоляющего голод.\nА. Моруа\n\nЖенщины созданы для того, чтобы их любили, а не для того, чтобы их понимали.\nОскар Уайльд\n','дети и все что сними связано'),(4156276,1,0,2,0,0,0,0,1350558443,'Артём','Шипулин',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL),(4262017,1,1,1,0,0,0,0,1402767600,'Инга','Рудницкая',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','','','',''),(4299752,1,1,2,0,0,0,1,1346992319,'Светлана','Индлина',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','идиот','','',''),(4358857,1,2,2,0,0,0,0,1410178889,'Сергей','Максимов',NULL,NULL,NULL,'верю в БОГА,но не верю в попов',NULL,NULL,NULL,NULL,'','','','Практически любая','','Различные'),(4531903,0,0,0,0,0,0,0,NULL,'DELETED','','deleted',NULL,NULL,NULL,NULL,NULL,NULL,N