 снять забыли.\n\n- Когда тебе служат Ангелы - это не означает, что ты будешь ими командовать.\nИ хотя их руки были в крови, они светились, как два крыла...\n\n- Вами управляет тот, кто Вас злит.\n\n- Хранить верность не любимому человеку - значит изменять самому себе.','На столько разнообразны, что затрудняюсь написать'),(6276758,2,292,2,0,0,0,4,1412084776,'Женько','Рунг',NULL,NULL,2,'Сэкред',NULL,NULL,NULL,NULL,'','ПУПС','Ярмо для Жулика','','Всё будет хорошо)','Разные'),(6330182,1,38,1,0,0,0,0,1282498193,'Алана','Ка',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL),(6563202,0,0,0,0,0,0,0,NULL,'DELETED','','deleted',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(6667972,0,0,2,0,1,0,0,1412088037,'Александр','Силиниченко',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL),(6678233,1,94,2,1,0,0,0,1412087084,'Руслан','Хакимов',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,',,',NULL,NULL,NULL,NULL,NULL),(6779702,2,314,1,0,0,0,4,1412077481,'Татьяна','Стукалова',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Мне??? Худеть???… Да во мне всего   45кг… остальное… Шарм,   Сексуальность и Харизма!!!)))','Девушка сложного поведения\n','Стефан Цвейг - Письма незнакомки, Куприн - Яма','','',''),(6894074,4,183,2,0,0,0,4,1412084224,'Евгений','Валерьевич',NULL,NULL,NULL,'Rock \'N\' Roll',6,6,5,NULL,'Кавабанга Кали-юга','','\"Афоризмы житейской мудрости\"','Led Zeppelin, Pink Floyd, Slipknot, Oasis, Aerosmith, RHCP... Пилот, Мертвые дельфины, СПЛИН, Animal Джаz!','Так бля, дорогие и многоуважаемые мои пИдЕрасты! 26 марта у меня др! Вы спросите: ааааа что же мы делать то будем?!\nОтвечу просто: Нахуяримся, для разнообразия!\nТак и бля по скольку я ограничен в финансовом вопросе, предлагаю что бы лавэ в с собой брали по возможности 2500-3000, предлагаю в Клаве давай.Если кто знает лучше место, ваше мнение учитываю, но в принципе мне на него насрать!\n\n(с) Виталий Алексеевич\n\nВот поэтому я и не женюсь...\n\n(с) Виталий Алексеевич\n\nТо, 