вдохновлять, соблазнять...\nНаходим записочки и приключения,\nскрываем свой возраст, обман, увлечения...\nПосуду и книги, еду подкупаем,\nв своей нереальности часто витаем,\nв сомненьях, бессоннице, самооценке,\nи волосы красим в любые оттенки...\nА между всем этим мы верим в ЛЮБОВЬ,\nстрадаем, клянём, и... влюбляемся вновь',''),(94076609,0,0,2,0,0,0,0,NULL,'Виктор','Юрьев','banned',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(94124027,1,1,1,0,0,0,6,1323195443,'Машуля','Соснова',NULL,NULL,3,'Верю в себя',NULL,NULL,NULL,NULL,'','Я\nангельская ________.888888888\nискренняя _______8888888888888\nбескорыстная____.88888888888888\nвесёлая ________8888888888888888\nграциозная ______888888888888888888.\nлюбвиобильная__8888888888888888888888.\nдружелюбная _____8888888888888888888_.88588\nженственная _______888888888888888888888888.\nжизнерадостная ___6888888888888888888888858.\nзаботливая ______88888888888888888888888868\nзагадочная _____8888888888888888888888888.\nзажигательная _888888888888888888888888885\nзастенчивая __8888888888888888888888888588\nигривая _____8888888888888888888888888688\nстильная ____68888_88888888888888888885\nстройная ___.8888..8888888888888888888\nтактичная __.8888__8888888888888888888\nминиатюрная _88888_6888888888888888888\nотзывчивая __.8888._888888888888888888\nромантичная __:8888.888888888888888888866\nулыбчивая _____688856888888888888888888886\nтрогательная ___6888888888888888888888888888\nсоблазнительная _888888888888888888888888886\nнемного стервочка__8888888888888888888888888\nнепосредственная _..888888888888888888888885\nразносторонняя ___88888888888888888888888888\nутончённая _____688888888888888888888888888\nмечтательная ___88.88888888888___8888888881\nнепредсказуемая ___88888888888_.__.88888888.\nэкстравагантная___18888888888______68888888\nчистосердечная ___.8888888888..______8888888\nчистолюбивая _____8888888888._______8888888.\nцелеустремлённая .888888888_________.8888886\nэнергичная _____.88888888____________88